import React from 'react';

// == Style
import CatalogStyled from './CatalogStyled';

const Catalog = () => {
  return (
    <CatalogStyled>
      <h2 className="title">Catalogue</h2>
      <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Impedit perspiciatis blanditiis iste at, dolorum non.</p>
      <div className="sort-bar">
        <ul className="sort-bar--list">
          <li className="sort-bar--element"><input type="radio" name="catalog-sort" id="alphabet-sort" /><label for="alphabet-sort">Tri alphabétique A-Z</label></li>
          <li className="sort-bar--element"><input type="radio" name="catalog-sort" id="last-product-sort" /><label for="last-product-sort">Derniers produits ajoutés</label></li>
          <li className="sort-bar--element"></li>
          <li className="sort-bar--element"><input type="radio" name="catalog-sort" id="bio-sort" /><label for="bio-sort">Tri alphabétique A-Z</label></li>
          <li className="sort-bar--element"><input type="radio" name="catalog-sort" id="-local-sort" /><label for="-local-sort">Tri alphabétique A-Z</label></li>
          <li className="sort-bar--element"></li>
        </ul>
      </div>
    </CatalogStyled>
  );
};

export default Catalog;
